// AboutPage.js
import React from 'react';

const AboutPage = () => {
  return (
    <div>
      <h1>About Us</h1>
      <h2> We are them. They are us. Cracked like black pepper and cooking like a five star chef  ★ ★ ★ ★ ★</h2>
      <button type="button">Click Me ABOUT</button>
    </div>
  );
};

export default AboutPage;
